import React from 'react';

const Card = () => {
    return (
        <div className="card">
            <div className="container">
                <img className="imgArea" src="./images/landscape_207075.jpg" />
            </div>
            <div className="category" id="text-start">
                <span>אוכל</span>
            </div>
            <div className="title" id="text-start">
                סיור קולינרי  בין המסעדות הערביות הכי טובות בחיפה
            </div>
            <div className="subTitle" id="text-start">
                גם אני, שעסוק כל השבוע, מתפנה לצפות בטלוויזיה רק בסופי השבוע, ונוכחתי שרוב תוכניות
                הטלוויזיה בכל הערוצים הן תוכניות אוכל.
            </div>
            <div className="author" id="text-start">שירית גל</div>
        </div>
    )
}

export default Card;

